(window.webpackJsonp=window.webpackJsonp||[]).push([[21],{1162:function(e,n){e.exports={content:["article",["h1","jQuery Tree Plugin ---- zTree"],["p","last verson :  3.5.23"],["p",["strong","Donate to zTree"]," : ",["a",{title:null,href:"http://www.ztree.me/v3/donate.php"},"http://www.ztree.me/v3/donate.php"]],["p","zTree API : ",["a",{title:null,href:"http://www.ztree.me/v3/api.php"},"http://www.ztree.me/v3/api.php"]],["p","zTree Demo : ",["a",{title:null,href:"http://www.ztree.me/v3/demo.php"},"http://www.ztree.me/v3/demo.php"]],["h1","Introduction of zTree (简介)"],["ul",["li",["p",'zTree is a multi-functional "tree plug-ins." based on jQuery. The main advantages of zTree includes excellent performance, flexible configuration, and the combination of multiple functions.\n(zTree 是一个依靠 jQuery 实现的多功能 “树插件”。优异的性能、灵活的配置、多种功能的组合是 zTree 最大优点。)']],["li",["p","zTree is a free tree plug-in and uses the MIT license. \n(zTree 是开源免费的软件, 使用 MIT 许可证)"]],["li",["p","The code of zTree v3.x has been seperated according to the various functions. You can only load the code you need. \n(zTree v3.x 将核心代码按照功能进行了分割，不需要的代码可以不用加载)"]],["li",["p","zTree v3.x uses delay loading technique, which can easily load tens of thousands of nodes in seconds even in IE6 browser. \n(采用了 延迟加载 技术，上万节点轻松加载，即使在 IE6 下也能基本做到秒杀)"]],["li",["p","Compatible with IE, FireFox?, Chrome, Opera, Safari and other browsers. \n(兼容 IE、FireFox?、Chrome、Opera、Safari 等浏览器)"]],["li",["p","Support for JSON data. \n(支持 JSON 数据)"]],["li",["p","Support for static and asynchronous data loading node. \n(支持静态 和 Ajax 异步加载节点数据)"]],["li",["p","Replace the skin / custom icon flexibllly. \n(支持任意更换皮肤 / 自定义图标)"]],["li",["p","Support extremely flexible checkbox or radio selection function. \n(支持极其灵活的 checkbox 或 radio 选择功能)"]],["li",["p","Provide enough incident response callback. \n(提供多种事件响应回调)"]],["li",["p","Flexible editing (add / delete / change / search) functions, such as drag and drop nodes,you can even drag and drop multiple nodes. \n(灵活的编辑（增/删/改/查）功能，可随意拖拽节点，还可以多节点拖拽哟)"]],["li",["p","Enable to generate multiple instances of zTree in one page. \n(在一个页面内可同时生成多个 Tree 实例)"]],["li",["p","Simple parameters to achieve flexible configuration capabilities. \n(简单的参数配置实现 灵活多变的功能)"]],["li",["p","To enhance performance, zTree transforms the js & css structure to provide excellent browser compatibility and make the development more easily\n(zTree v3.x（JQuery Tree 插件），性能全面提升，js & css 架构全面调整，提供更好的兼容性和易开发性)"]]]],meta:{filename:"components/ns-tree/old/lib/ztree/README.md"},toc:["ul",["li",["a",{className:"bisheng-toc-h1",href:"#jQuery-Tree-Plugin------zTree",title:"jQuery Tree Plugin ---- zTree"},"jQuery Tree Plugin ---- zTree"]],["li",["a",{className:"bisheng-toc-h1",href:"#Introduction-of-zTree-(简介)",title:"Introduction of zTree (简介)"},"Introduction of zTree (简介)"]]]}}}]);